description:
Presenting the Teaser Trailer of the most awaited film of 2013 - DHOOM:3. Starring Aamir Khan, Abhishek Bachchan, Katrina Kaif &amp; Uday Chopra.

DHOOM:3 Film releases on 20th December 2013.

Produced by Aditya Chopra, DHOOM:3 is written and directed by Vijay Krishna Acharya, who had also written DHOOM &amp; DHOOM:2. Apart from Aamir Khan, who plays the anti-hero in the film, and Katrina Kaif, both Abhishek Bachchan and Uday Chopra will continue in their now iconic roles of Jai Dixit and Ali.
